    .close-btn {
      position: absolute;
      top: 10px;
      right: 10px;
      background: transparent;
      border: none;

      color: #333;
      cursor: pointer;

      font-size: 1em;

      margin-top: 5px;

      border: none;

      cursor: pointer;
      font-size: 1em;
      text-decoration: none;

        margin-top: 5px;
        background: #c2c6cb;
        color: #0011ff;
        border: .8px solid #0011ff;
        border-radius: 5px;
        cursor: pointer;
        font-size: 1em;
        text-decoration: none;
        padding: 9px 15px 10px 15px;
